import { useState, useEffect } from 'react';
import { ShoppingBag, ArrowRight, Instagram, Mail, MessageCircle } from 'lucide-react';

export default function HomePage() {
  const [isLoaded, setIsLoaded] = useState(false);

  useEffect(() => {
    setIsLoaded(true);
  }, []);

  // Navigation function (simulating react-router-dom's navigate)
  const navigateTo = (path) => {
    console.log(`Navigating to: ${path}`);
    // In a real app with react-router-dom, this would be: navigate(path)
  };

  return (
    <main className="min-h-screen bg-slate-900 text-white flex flex-col">
      {/* Animated gradient background */}
      <div className="absolute inset-0 bg-gradient-to-br from-slate-900 via-slate-800 to-slate-900 opacity-80 z-0"></div>
      
      {/* Hero Section */}
      <div className="flex-grow flex flex-col items-center justify-center px-6 relative z-10">
        <div 
          className={`flex flex-col items-center gap-8 max-w-lg mx-auto transition-all duration-1000 ${
            isLoaded ? 'opacity-100 translate-y-0' : 'opacity-0 translate-y-8'
          }`}
        >
          {/* Logo with glow effect */}
          <div className="relative">
            <div className="absolute -inset-1 bg-gradient-to-r from-teal-400 to-cyan-400 rounded-2xl blur-lg opacity-75 group-hover:opacity-100 transition duration-1000 animate-pulse"></div>
            <img
              src="/api/placeholder/120/120"
              alt="Safeswap Logo"
              className="relative h-28 w-28 rounded-2xl shadow-2xl border border-slate-700"
            />
          </div>

          {/* Platform name with animated text */}
          <h1 className="text-6xl font-extrabold text-transparent bg-clip-text bg-gradient-to-r from-teal-400 to-cyan-500">
            Safeswap
          </h1>
          
          <p className="text-slate-300 text-center font-medium text-lg">
            A forma mais segura para compra e revenda de ingressos
          </p>

          {/* Main CTA button */}
          <button
            onClick={() => navigateTo('/festas')}
            className="mt-6 bg-gradient-to-r from-emerald-500 to-teal-500 hover:from-emerald-400 hover:to-teal-400 text-white px-8 py-4 rounded-xl text-xl font-bold transition duration-300 transform hover:scale-105 hover:shadow-teal-500/50 shadow-xl flex items-center justify-center gap-3 w-full max-w-xs"
          >
            <ShoppingBag size={20} />
            Comprar ingressos
          </button>

          {/* Secondary link with subtle hover effect */}
          <button
            onClick={() => navigateTo('/revenda')}
            className="text-teal-400 hover:text-teal-300 text-base transition-all duration-300 flex items-center gap-2 group mt-2"
          >
            <span>Intermediação de revendas</span>
            <ArrowRight size={16} className="transition-transform duration-300 group-hover:translate-x-1" />
          </button>
        </div>
      </div>

      {/* Social proof section */}
      <div className="py-6 px-4 bg-slate-800/50 backdrop-blur-sm border-t border-slate-700/50 text-center relative z-10">
        <p className="text-slate-300 font-medium mb-2">Confiado por mais de 10.000 clientes</p>
        <div className="flex justify-center gap-4">
          <div className="flex -space-x-2">
            {[1, 2, 3, 4, 5].map((i) => (
              <div key={i} className="w-8 h-8 rounded-full bg-gradient-to-r from-slate-500 to-slate-600 border-2 border-slate-800 flex items-center justify-center text-xs font-bold text-white">
                {i}
              </div>
            ))}
          </div>
          <div className="flex items-center">
            <div className="flex items-center">
              {[1, 2, 3, 4, 5].map((star) => (
                <svg key={star} className="w-4 h-4 text-yellow-400" fill="currentColor" viewBox="0 0 20 20">
                  <path d="M9.049 2.927c.3-.921 1.603-.921 1.902 0l1.07 3.292a1 1 0 00.95.69h3.462c.969 0 1.371 1.24.588 1.81l-2.8 2.034a1 1 0 00-.364 1.118l1.07 3.292c.3.921-.755 1.688-1.54 1.118l-2.8-2.034a1 1 0 00-1.175 0l-2.8 2.034c-.784.57-1.838-.197-1.539-1.118l1.07-3.292a1 1 0 00-.364-1.118l-2.8-2.034c-.783-.57-.38-1.81.588-1.81h3.461a1 1 0 00.951-.69l1.07-3.292z"></path>
                </svg>
              ))}
            </div>
            <span className="ml-2 text-slate-300 font-medium">4.9/5</span>
          </div>
        </div>
      </div>

      {/* Footer with contact information */}
      <footer className="bg-slate-900 text-center text-slate-400 border-t border-slate-800 py-6 px-4 relative z-10">
        <div className="flex flex-wrap justify-center gap-6 mb-4">
          <a 
            href="mailto:ajuda@safeswapbr.com" 
            className="flex items-center gap-2 text-slate-300 hover:text-teal-400 transition-colors duration-300"
          >
            <Mail size={18} />
            <span>ajuda@safeswapbr.com</span>
          </a>
          <a 
            href="https://wa.me/5511933478389" 
            target="_blank" 
            rel="noopener noreferrer" 
            className="flex items-center gap-2 text-slate-300 hover:text-teal-400 transition-colors duration-300"
          >
            <MessageCircle size={18} />
            <span>(11) 93347-8389</span>
          </a>
          <a 
            href="https://instagram.com/safeswap_" 
            target="_blank" 
            rel="noopener noreferrer" 
            className="flex items-center gap-2 text-slate-300 hover:text-teal-400 transition-colors duration-300"
          >
            <Instagram size={18} />
            <span>@safeswap_</span>
          </a>
        </div>
        <p className="text-sm text-slate-500">© {new Date().getFullYear()} SafeSwap. Todos os direitos reservados.</p>
      </footer>
    </main>
  );
}
